INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 1001, 1, 1, 1.4, 0, 2, "お！\nあそこに困ってそうな人発見！", 0, 1, 0, 0, "春咲 ひより", "ねぇねぇ、騎士クン\n手伝ってあげようよ～");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "みんなみたいに\nわたしも強くならなきゃ", 1002, 1, 1, 1.4, 0, 2, "大切な人を\n守れるようになりたい…って", 0, 1, 0, 0, "草野 優衣", "わ、わたし、\nなに言ってるんだろ\nあはは…");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "フェンシングを始めてみては？", 1003, 1, 1, 1.4, 0, 2, "キミに必要な集中力と感性が", 0, 1, 0, 0, "士条 怜", "少しは磨かれると思いますよ。");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "ねぇ、にいちゃん！", 1004, 1, 1, 1.5, 0, 2, "今日はなにして遊ぶ？", 0, 1, 0, 0, "穂高 みそぎ", "みそぎはねぇ、\nかくれんぼやりたい！");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "風宮あかりです", 1006, 1, 1, 1.4, 0, 2, "ねぇ…", 0, 1, 0, 0, "風宮 あかり", "私といっしょに…\nいかない？");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "出雲宮子なのー", 1007, 1, 1, 1.5, 0, 2, "プリンたべたいのー", 0, 1, 0, 0, "出雲 宮子", "食べ物の恨みは怖いのー");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "ボクは虹村雪。", 1008, 1, 1, 1.4, 0, 2, "キミもボクの美貌に\n吸い寄せられたんだね。", 0, 1, 0, 0, "虹村 雪", "いいよ。\n見られることは運命さ…");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "フッ…聞いて後悔するがいい！", 1009, 1, 1, 1.4, 0, 2, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 0, 1, 0, 0, "柊杏奈", "人呼んで「疾風の冥姫」!!");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "マホマホ王国のプリンセス、\nまほ姫どす", 1010, 1, 1, 1.5, 0, 2, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 0, 1, 0, 0, "姫宮 真歩", "ほんまおおきにやわ～♪");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "衣之咲璃乃です！", 1011, 1, 1, 1.4, 0, 2, "生き別れたお兄ちゃんを探して\n三千世界！", 0, 1, 0, 0, "衣之咲 璃乃", "ここで会ったが\n100年目～！");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 1012, 1, 1, 1.4, 0, 2, "ち、超能力って…\n何のことかな～？", 0, 1, 0, 0, "柏崎 初音", "…って、お願い！\n誰にも言わないでおいて～！");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "ちょす！\n美波鈴奈だよ～♪", 1016, 1, 1, 1.4, 0, 2, "一応カリスマ読モJKやってまっす！", 0, 1, 0, 0, "美波 鈴奈", "ヒデサイまぢ\nGF（グッドフィーリング）～♪");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "はいたーい。\n喜屋武香織さー。", 1017, 1, 1, 1.4, 0, 2, "東京は遊園地みたいなところさー", 0, 1, 0, 0, "喜屋武 香織", "でも、沖縄もとってもいいとこさー");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "支倉伊緒です。", 1018, 1, 1, 1.4, 0, 2, "先生って呼ばれるのは\nくすぐったいから", 0, 1, 0, 0, "支倉 伊緒", "イオちゃんって呼んでね。");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 1020, 1, 1, 1.5, 0, 2, "あ！/\お兄ちゃ～ん\nまってよ～", 0, 1, 0, 0, "茜 ミミ", "ミミをおいてかないでぇ～");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "あ…あの…えっと…\n栗…林…くるみ…です……", 1021, 1, 1, 1.5, 0, 2, "あの……\nふぇ……", 0, 1, 0, 0, "栗林 くるみ", "ふぇぇぇぇぇん……");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "風宮よりです。\nあああああ！", 1022, 1, 1, 1.4, 0, 2, "こんな私に貴重な時間を\n割いていただき、", 0, 1, 0, 0, "風宮 より", "なんてありがとうございます！");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 1023, 1, 1, 1.5, 0, 2, "おにいちゃんどこいくの？\nえ？", 0, 1, 0, 0, "北条 綾音", "私こっち行きたいー\nね、早く早くー");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "わっ…わっ…私、\n天野すずめといいます！", 1025, 1, 1, 1.4, 0, 2, "ふ、不束者ですが\nどうぞ末永く…って、", 0, 1, 0, 0, "天野 すずめ", "これて何か違う…\nあああすみません！");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "……クスクス…私は\n…倉石恵理子……", 1027, 1, 1, 1.4, 0, 2, "あなたは…運命の……\n伴侶……", 0, 1, 0, 0, "倉石 恵理子", "離しませんわ………\n絶対に…!!");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 1028, 1, 1, 1.4, 0, 2, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 0, 1, 0, 0, "佐々木 咲恋", "…そうでしょ？？");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "桜井望だよ！\nよろしくねっ", 1029, 1, 1, 1.4, 0, 2, "ぇっと…\nキミ、私のこと知らないの?!", 0, 1, 0, 0, "桜井 望", "あはは、\n私もまだまだだなぁ～");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "デケデケデンっ！", 1030, 1, 1, 1.4, 0, 2, "初めまして、\n私はニノン・ジュベール申すデス！", 0, 1, 0, 0, "ニノン・ジュベール", "ショーグン、\nワタシと一緒に天下統一デース！");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "上喜しのぶです。\n手元のドクロが父です。", 1031, 1, 1, 1.4, 0, 2, "でもって私の隣にいるのが……\nえ、見えない？", 0, 1, 0, 0, "上喜 しのぶ", "おかしいですね……");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "目指すはビッグな\nお笑い芸人だっぺ！", 1033, 1, 1, 1.5, 0, 2, "けんども\nそれには足りないモンが…", 0, 1, 0, 0, "野戸まひる", "そう、\nオラのボケに突っ込める相方が…！");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 1034, 1, 1, 1.4, 0, 2, "ちょっと緊張しちゃって…", 0, 1, 0, 0, "綾瀬 ゆかり", "ちょ\nちょっと一杯飲んできます…！");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "氷川鏡華…です", 1036, 1, 1, 1.5, 0, 2, "知らない人とは話しちゃいけないので", 0, 1, 0, 0, "氷川 鏡華", "これ以上お話しすることは…\nないです！");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "柏崎…栞です。", 1038, 1, 1, 1.4, 0, 2, "……あ、アラーム。", 0, 1, 0, 0, "柏崎 栞", "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "ふ、双葉碧です。", 1040, 1, 1, 1.4, 0, 2, "私、一人も友達がいなくて……", 0, 1, 0, 0, "双葉 碧", "野に咲く花が、\n唯一の話相手です。");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "三角千歌です。", 1042, 1, 1, 1.4, 0, 2, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 0, 1, 0, 0, "三角 千歌", "そう思っています。");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "安芸真琴だ。", 1043, 1, 1, 1.4, 0, 2, "あぁ？\nお前のそいつの仲間か？", 0, 1, 0, 0, "安芸 真琴", "う、疑ってすまなかったな…");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "わらわこそは夜を総べる者！", 1044, 1, 1, 1.4, 0, 2, "生けとし生ける全ての者よ！", 0, 1, 0, 0, "イリヤ・オーンスタイン", "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "そこで騎士は妖精を乱暴に……", 1045, 1, 1, 1.4, 0, 2, "ぐふふふふ……はっ！", 0, 1, 0, 0, "遠見 空花", "ｌク、クウカに何かご用ですか!?");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 1046, 1, 1, 1.4, 0, 2, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 0, 1, 0, 0, "宮坂たまき", "う～ん…\n猫ってホントに最高にゃ～♪");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "大神美冬よ！", 1048, 1, 1, 1.4, 0, 2, "それでは早速クエストに…", 0, 1, 0, 0, "大神 美冬", "…と思ったら\nバイトの時間だ！\nまたあとでね！");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "星野静流だよ！", 1049, 1, 1, 1.4, 0, 2, "クエストもバトルも\n掃除も洗濯も", 0, 1, 0, 0, "星野静流", "お姉ちゃんがぜ～んぶ\nやってあげるからね！");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "アタシは玉泉美咲。", 1050, 1, 1, 1.5, 0, 2, "見ての通りの\nセクシー美少女で", 0, 1, 0, 0, "玉泉美咲", "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "？？？", 1052, 1, 1, 1.4, 0, 2, "？？？？", 0, 1, 0, 0, "リマ", "？？？？");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "モニカ・ヴァイスヴィントだ。", 1053, 1, 1, 1.5, 0, 2, "菓子でつろうなどと\n稚拙な策を……", 0, 1, 0, 0, "モニカ・ヴァイスヴィント", "そ、そこまでいうなら\nもらってやる");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "モニカ・ヴァイスヴィントだ。", 1058, 1, 1, 1.5, 0, 2, "菓子でつろうなどと\n稚拙な策を……", 0, 1, 0, 0, "ペコリーヌ", "そ、そこまでいうなら\nもらってやる");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "モニカ・ヴァイスヴィントだ。", 1059, 1, 1, 1.5, 0, 2, "菓子でつろうなどと\n稚拙な策を……", 0, 1, 0, 0, "コッコロ", "そ、そこまでいうなら\nもらってやる");
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, "モニカ・ヴァイスヴィントだ。", 1060, 1, 1, 1.5, 0, 2, "菓子でつろうなどと\n稚拙な策を……", 0, 1, 0, 0, "キャル", "そ、そこまでいうなら\nもらってやる");
